import React, {FC} from 'react';
import {Box, Divider} from '@mui/material';

interface values {
    title: string;
    value: string;
}
const SummarySection:FC<{values: values[],sectionName:string}> = (props) => {
    return (
        <Box>
            <h2 className={'text-center font-bold'}>{props.sectionName}</h2>
            <ul className={'w-full space-y-2'}>
                {props.values.map((value) => {
                    return (
                        <li className={'w-full'}>{value.title}: <span className={'w-full text-center'}>{value.value}</span></li>
                    )
                })}
            </ul>
            <Divider>
                {props.values.map((value) => {
                    return (
                        <li className={'w-full'}>{value.title}: <span className={'w-full text-center'}>{value.value}</span></li>
                    )
                })}
            </Divider>
        </Box>

    );
};

export default SummarySection;
